INSERT INTO `deliverable_partnerships` VALUES ('2030', '1851', '68', 'Resp', '1', '2016-08-04 08:25:28', '181', '181', 'The keynote speech offered the opportunity to engage with regional stakeholders. Implication of current climate change policies after COP 21 have been discussed.Several recommendation were made. Among others:\r\n\r\n- Promote Synergies among ASEAN countries on promoting Good Agriculture Practice as main pillar of Climate-smart Agriculture \r\n- Different stakeholders should be provided with diversified information packages and decision support tools\r\n- Scientific findings and publications will NOT be sufficient as such to stimulate mitigation but, should be translated into clear spatial and temporal priorities at different scales');
